import React from 'react';
import './GoodsItems.css';


const goodsItem = () => {
    return (
        <header>
            <img src="https://source.unsplash.com/random/?nature,water" className="itemsImg" />
            <div class="goods-items">
                <span>
                    <p></p>
                </span>
            </div>
        </header>
    )
}

export default goodsItem;
